CREATE FUNCTION public.check_linea_match() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  linea_partita INT;
BEGIN
    SELECT p.id_linea 
    INTO linea_partita
    FROM partita p
    WHERE p.CODICE_PARTITA = NEW.CODICE_PARTITA;

    IF NEW.id_linea != linea_partita THEN
