--

CREATE FUNCTION public.trg_set_costo_articolo() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    costo_tot DECIMAL(10,2);
    num_art   INT;
BEGIN
    SELECT CostoTotale, NumeroArticoli
    INTO costo_tot, num_art
    FROM PARTITA
    WHERE CODICE_PARTITA = NEW.CODICE_PARTITA;

    IF num_art <= 0 THEN
        RAISE EXCEPTION 'Errore: NumeroArticoli in PARTITA = %, non posso calcolare Costo', num_art;
    END IF;

    NEW.Costo := costo_tot / num_art;
    RETURN NEW;
END;
$$;


