BEGIN
    IF (TG_OP = 'INSERT') THEN
        IF NEW.ID_ORDINE IS NOT NULL THEN
            UPDATE ORDINE
                SET NumeroArticoli = NumeroArticoli+ 1, PrezzoTotale = PrezzoTotale + NEW.Costo
